import React from 'react';
import { useFetch } from './hooks';

const PORT = 6287;

let baseUrl = `http://127.0.0.1:${PORT}/get_stocks_data?stocks=["${'AAPL'}"]&startDate=${'2019-01-01'}&endDate=${'2020-01-01'}`;

function Joke() {
  const { message, data } = useFetch(baseUrl, {});
  console.log(message);
  console.log(JSON.parse(data))
  return (
    <div>
      <h3>Joke of the session</h3>
      <p><em>{message}</em></p>
        <p>{console.log(data)}</p>
        <p>{
            // console.log(JSON.parse(JSON.stringify(data)))
            data
        }</p>
    </div>
  )
}

export default Joke;
